product33.description:
Robot din plus moale.
Are la bazã principiile roboticii biomorfice ;
Buton “Try Me” pentru demonstratie sunete si miscãri ochi/gurã ;
Scoate sunete ce le imitã pe cele ale unui pui real si a cãror intensitate poate fi reglatã ;
Moale si usor de indrãgit de cãtre copii ;
Gurã care se poate misca si ochi care clipesc ;
Senzori tactili pe cap si spate activati cand puiul este mangaiat;
puiul va scanci si va marai ;
Senzor de inclinare, care ii permite sã stie dacã e in picioare sau culcat ;
Echipat cu un regim economic in care intrã, dacã nu e folosit mai mult de 5 minute ;
Trei pozitii ale butonului ON/OFF: ON „ Try me”, OFF si ON „Normal”;
Baterii necesare pentru pui : 4 baterii Alcaline Tip „AA” ( incluse) ;

